import { FETCH_DATA } from '../actions/types';

const dataReducer = (state = [], action) => {
  switch (action.type) {
    case FETCH_DATA:
      return {
        ...state,
        data: action.payload,
        key: action.payload.id,
      };
    default:
      return state;
  }
};

export default dataReducer;
